from typing import List

class Solution:
    def minOperations(self, nums: List[int]) -> int:
        '''
            Each flip of an element influences the fate of the elements after it.
            Let's say the current element is 0. We want to know if its final value after N flips is 0.
            If so, we will have to flip it once more to set it to 1.
                0 + 0 flips = 0
                0 + 2 flips = 0
                0 + 4 flips = 0 or, 0 + even_number_of_flips = 0
            Similarly, let's say the current element is 1. We want to know if its final value after
            N flips is 0. If so, we will have to flip it once more to set it to 1.
                1 + 1 flip  = 0
                1 + 3 flips = 0
                1 + 5 flips = 0 or, 1 + odd_number_of_flips = 0
        '''
        N = len(nums)
        flips = 0
        for i, v in enumerate(nums):
            if (v + flips) % 2 == 0:
                flips += 1
        return flips

